"""Konsep Dasar

DFS adalah algoritma penelusuran graf yang menggunakan prinsip Last-In-First-Out (LIFO) dengan:

- Stack (rekursi atau stack eksplisit) untuk menyimpan node yang akan dieksplorasi.

- "Jelajahi sedalam mungkin" sebelum backtracking.

Detail Teknis

- Kompleksitas:

 - Waktu: O(|V| + |E|) untuk graf adjacency list (V = vertex, E = edge).

 - Ruang: O(|V|) untuk rekursi (tergantung kedalaman stack).

- Jenis-Jenis DFS:

 - Pre-order: Kunjungi node sebelum anak-anaknya (digunakan untuk cloning trees).

 - Post-order: Kunjungi node setelah anak-anaknya (digunakan untuk menghapus tree).

 - In-order (khusus binary tree): Kunjungi subtree kiri → node → subtree kanan.

- Backtracking:

 - Teknik DFS dengan "mencoba semua kemungkinan" dan mundur jika gagal (misal: puzzle N-Queens).

Implementasi lengkap dengan variasi
"""

# 1. DFS Rekursif (Paling Sederhana)
def dfs_recursive(graph, node, visited=None, path=None):
    if visited is None:
        visited = set()
    if path is None:
        path = []
    visited.add(node)
    path.append(node)
    for neighbor in graph[node]:
        if neighbor not in visited:
            dfs_recursive(graph, neighbor, visited, path)
    return path

# 2. DFS dengan Stack (Eksplisit, Non-Rekursif)
def dfs_stack(graph, start):
    stack = [start]
    visited = set()
    path = []
    while stack:
        node = stack.pop()
        if node not in visited:
            visited.add(node)
            path.append(node)
            # Push neighbors in reverse order untuk urutan yang sama seperti rekursif
            for neighbor in reversed(graph[node]):
                if neighbor not in visited:
                    stack.append(neighbor)
    return path

# 3. DFS dengan Tracking Path ke Goal
def dfs_path(graph, start, goal):
    stack = [(start, [start])]
    visited = set()
    while stack:
        node, path = stack.pop()
        if node == goal:
            return path
        if node not in visited:
            visited.add(node)
            for neighbor in reversed(graph[node]):
                if neighbor not in visited:
                    stack.append((neighbor, path + [neighbor]))
    return None

"""Deteksi Cycle dengan DFS"""

def has_cycle(graph):
    visited = set()
    recursion_stack = set()  # Untuk melacak path aktif

    def dfs(node):
        visited.add(node)
        recursion_stack.add(node)
        for neighbor in graph[node]:
            if neighbor not in visited:
                if dfs(neighbor):
                    return True
            elif neighbor in recursion_stack:
                return True
        recursion_stack.remove(node)
        return False

    for node in graph:
        if node not in visited:
            if dfs(node):
                return True
    return False

"""Optimasi dan Variasi Lanjutan

- Iterative Deepening DFS (IDDFS):

 - Gabungkan DFS dan BFS dengan batas kedalaman bertahap.

 - Kompleksitas ruang O(bd), waktu O(b^d).
"""

def iddfs(graph, start, goal, max_depth):
    for depth in range(max_depth + 1):
        visited = set()
        stack = [(start, [start], 0)]
        while stack:
            node, path, current_depth = stack.pop()
            if node == goal:
                return path
            if current_depth < depth:
                if node not in visited:
                    visited.add(node)
                    for neighbor in reversed(graph[node]):
                        stack.append((neighbor, path + [neighbor], current_depth + 1))
    return None

"""- DFS untuk Komponen Terhubung (Undirected Graph):"""

def connected_components(graph):
    visited = set()
    components = []
    for node in graph:
        if node not in visited:
            component = []
            stack = [node]
            while stack:
                current = stack.pop()
                if current not in visited:
                    visited.add(current)
                    component.append(current)
                    for neighbor in graph[current]:
                        stack.append(neighbor)
            components.append(component)
    return components

