from collections import deque

# 1. BFS Standar (Tanpa Path Tracking)
def bfs_standard(graph, start):
    visited = set()
    queue = deque([start])
    visited.add(start)
    order = []

    while queue:
        node = queue.popleft()
        order.append(node)
        for neighbor in graph[node]:
            if neighbor not in visited:
                visited.add(neighbor)
                queue.append(neighbor)
    return order

# 2. BFS dengan Path Tracking ke Goal
def bfs_path(graph, start, goal):
    queue = deque([(start, [start])])
    visited = set()

    while queue:
        node, path = queue.popleft()
        if node == goal:
            return path
        if node not in visited:
            visited.add(node)
            for neighbor in graph[node]:
                if neighbor not in visited:
                    queue.append((neighbor, path + [neighbor]))
    return None

# 3. BFS untuk Level Order (Binary Tree)
def bfs_level_order(root):
    if not root:
        return []
    queue = deque([root])
    result = []
    while queue:
        level_size = len(queue)
        current_level = []
        for _ in range(level_size):
            node = queue.popleft()
            current_level.append(node.val)
            if node.left:
                queue.append(node.left)
            if node.right:
                queue.append(node.right)
        result.append(current_level)
    return result

"""Deteksi Komponen Terhubung (Connected Components)"""

def connected_components_bfs(graph):
    visited = set()
    components = []

    for node in graph:
        if node not in visited:
            queue = deque([node])
            visited.add(node)
            component = []
            while queue:
                current = queue.popleft()
                component.append(current)
                for neighbor in graph[current]:
                    if neighbor not in visited:
                        visited.add(neighbor)
                        queue.append(neighbor)
            components.append(component)
    return components

"""Aplikasi Khusus BFS

- Shortest Path dalam Unweighted Graph:

 - Contoh: Rute terpendek dalam peta grid (tanpa bobot).
"""

def shortest_path_unweighted(graph, start, end):
    queue = deque([(start, 0)])  # (node, distance)
    visited = set([start])

    while queue:
        node, dist = queue.popleft()
        if node == end:
            return dist
        for neighbor in graph[node]:
            if neighbor not in visited:
                visited.add(neighbor)
                queue.append((neighbor, dist + 1))
    return -1  # Tidak terhubung

"""- Web Crawling:

 - BFS digunakan oleh mesin pencari untuk mengindeks halaman level demi level.

- Puzzle Solving (15-Puzzle, Rubik's Cube):

 - BFS menjamin solusi optimal (tetapi membutuhkan memori besar).

- Jaringan Sosial (Friend-of-Friend Recommendations):

 - Eksplorasi jaringan sosial hingga kedalaman tertentu.

Optimasi dan Variasi Lanjutan

- Bidirectional BFS:

 - Jalankan BFS dari start dan goal secara bersamaan.

 - Efisiensi: O(b^(d/2)) vs O(b^d) pada BFS standar.
"""

def bidirectional_bfs(graph, start, goal):
    if start == goal:
        return [start]

    # Inisialisasi dua queue dan visited sets
    queue_start = deque([(start, [start])])
    queue_goal = deque([(goal, [goal])])
    visited_start = {start: [start]}
    visited_goal = {goal: [goal]}

    while queue_start and queue_goal:
        # Ekspansi dari start
        node, path = queue_start.popleft()
        for neighbor in graph[node]:
            if neighbor in visited_goal:
                return path + visited_goal[neighbor][::-1]
            if neighbor not in visited_start:
                visited_start[neighbor] = path + [neighbor]
                queue_start.append((neighbor, path + [neighbor]))

        # Ekspansi dari goal
        node, path = queue_goal.popleft()
        for neighbor in graph[node]:
            if neighbor in visited_start:
                return visited_start[neighbor] + path[::-1]
            if neighbor not in visited_goal:
                visited_goal[neighbor] = path + [neighbor]
                queue_goal.append((neighbor, path + [neighbor]))
    return None

"""- Multi-source BFS:

 - Memulai dari beberapa node sekaligus (contoh: penyebaran api dalam game).
"""

def multi_source_bfs(graph, sources):
    queue = deque(sources)
    visited = {source: 0 for source in sources}

    while queue:
        node = queue.popleft()
        for neighbor in graph[node]:
            if neighbor not in visited:
                visited[neighbor] = visited[node] + 1
                queue.append(neighbor)
    return visited

