import heapq

def a_star(graph, start, goal, heuristic):
    open_set = [(0 + heuristic[start], 0, start, [])]  # (f, g, node, path)
    closed_set = set()

    while open_set:
        f, g, node, path = heapq.heappop(open_set)
        if node == goal:
            return path + [node], g
