"""Implementasi A untuk 8 Puzzle"""

import heapq

# Fungsi menghitung jarak Manhattan pada 8-puzzle
def manhattan_8puzzle(state, goal):
    distance = 0
    for i in range(3):
        for j in range(3):
            val = state[i][j]
            if val != 0:
                for x in range(3):
                    for y in range(3):
                        if goal[x][y] == val:
                            distance += abs(i - x) + abs(j - y)
    return distance

# Fungsi untuk menghasilkan gerakan yang mungkin dari sebuah state
def generate_moves(state):
    moves = []
    directions = {'Up': (-1, 0), 'Down': (1, 0), 'Left': (0, -1), 'Right': (0, 1)}

    # Cari posisi kosong (0)
    for i in range(3):
        for j in range(3):
            if state[i][j] == 0:
                x, y = i, j
                break

    for move, (dx, dy) in directions.items():
        nx, ny = x + dx, y + dy
        if 0 <= nx < 3 and 0 <= ny < 3:
            # Buat salinan dan tukar posisi
            new_state = [list(row) for row in state]
            new_state[x][y], new_state[nx][ny] = new_state[nx][ny], new_state[x][y]
            moves.append((move, tuple(tuple(row) for row in new_state)))

    return moves

# Solver
def solve_8puzzle(start, goal):
    heuristic = lambda s: manhattan_8puzzle(s, goal)
    open_set = [(heuristic(start), 0, start, [])]
    closed_set = set()

    while open_set:
        f, g, state, path = heapq.heappop(open_set)
        if state == goal:
            return path
        if str(state) not in closed_set:
            closed_set.add(str(state))
            for move, new_state in generate_moves(state):
                new_g = g + 1
                heapq.heappush(
                    open_set,
                    (new_g + heuristic(new_state), new_g, new_state, path + [move])
                )
    return None

# Contoh penggunaan
