def gbfs_maze(maze, start, goal, heuristic):
    from heapq import heappush, heappop
    open_list = []
    heappush(open_list, (heuristic(start, goal), start, [start]))
    visited = set()

    while open_list:
        _, (x, y), path = heappop(open_list)
        if (x, y) == goal:
            return path
        if (x, y) not in visited:
            visited.add((x, y))
            for dx, dy in [(0,1), (1,0), (0,-1), (-1,0)]:  # 4 arah gerak
                nx, ny = x + dx, y + dy
                if 0 <= nx < len(maze) and 0 <= ny < len(maze[0]) and maze[nx][ny] == 0:
                    heappush(open_list, (heuristic((nx, ny), goal), (nx, ny), path + [(nx, ny)]))
    return None

