import heapq

def jump_point_search(grid, start, goal):
    def heuristic(a, b):
        # Menggunakan jarak Manhattan
        return abs(a[0] - b[0]) + abs(a[1] - b[1])

    def in_bounds(x, y):
        return 0 <= x < len(grid) and 0 <= y < len(grid[0])

    def is_passable(x, y):
        return grid[x][y] == 0

    def get_neighbors(pos, direction=None):
        # Ini perlu di-prune sesuai arah datang (untuk JPS)
        # Saat ini masih versi dasar
        x, y = pos
        directions = [(-1,0), (1,0), (0,-1), (0,1)]
        neighbors = []
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if in_bounds(nx, ny) and is_passable(nx, ny):
                neighbors.append(((nx, ny), (dx, dy)))
        return neighbors

    def jump(x, y, dx, dy):
        # Fungsi inti untuk melompat ke jump point berikutnya
        nx, ny = x + dx, y + dy
        if not in_bounds(nx, ny) or not is_passable(nx, ny):
            return None
        if (nx, ny) == goal:
            return (nx, ny)
        # Tambahkan deteksi forced neighbor di sini jika perlu
        return jump(nx, ny, dx, dy)

    open_list = []
    heapq.heappush(open_list, (heuristic(start, goal), 0, start, []))
    visited = set()

    while open_list:
        f, g, current, path = heapq.heappop(open_list)
        if current == goal:
            return path + [current]

        if current in visited:
            continue
        visited.add(current)

        for (neighbor, direction) in get_neighbors(current):
            result = jump(current[0], current[1], direction[0], direction[1])
            if result:
                new_g = g + 1
                new_f = new_g + heuristic(result, goal)
                heapq.heappush(open_list, (new_f, new_g, result, path + [current]))

    return None

